import React from "react";

import { About, Footer, Header, Skills, Testimonial, Work } from './container';
import { Navbar } from './components';
const App = () => {
  return (
    <div className="">
      <Navbar />
      <About />
      <Header />
      <Work />
      <Skills />
      <Testimonial />
      <Footer />
    </div>
  );
};

export default App;
